var wordClassNames = {
	Noun: "gematriabot-pos gematriabot-pos-noun",
	Verb: "gematriabot-pos gematriabot-pos-verb",
	Adj: "gematriabot-pos gematriabot-pos-adjective",
	Adv: "gematriabot-pos gematriabot-pos-adverb",
	Num: "gematriabot-pos gematriabot-pos-number",
	Othr: "gematriabot-pos gematriabot-pos-other"
}

window.onload = function() {
	var inputEl = get("gematriabot-input");
	var checkboxContainerEl = get("gematriabot-checkbox-container");
	var outputEl = get("gematriabot-output");
	
	inputEl.oninput = function(e) {
		// Clear the output
		outputEl.innerHTML = "";
		// If input is empty except for spaces, don't add anything to the output
		var val = inputEl.value;
		if (val.isNullOrWhitespace()) return;
		
		// Don't reduce mod 26 by default
		var mod26 = false;
		// This is not a number search by default
		var isNumber = false;
		// If it's a singular Gematrimax Cheat Mode command...
		var regexMatch = val.match(/^\s*(#|_?\[|[\]=?;+\-*/%!$&><\\)(}{,.:@])\s*$/);
		if (regexMatch)
		{
			// Find the command's value
			val = gmxCommands.find(cmd => cmd.cmd == regexMatch[1]).val;
			// Mod the gematria by 26
			mod26 = true;
			// This is a numerical search
			isNumber = true;
		}
		// If it's a number...
		// (Assignment in a conditional? Impossible!)
		else if (regexMatch = val.match(/^\s*(\d+)\s*$/))
		{
			// Parse the number
			val = Number(regexMatch[1]);
			// This is a numerical search
			isNumber = true;
		}
		
		// If we are conducting a numerical search of the dictionary...
		if (isNumber)
		{
			// Populate the specific parts-of-speech list
			posList = [];
			checkboxContainerEl.getElementsByTagName("input").forEach(function(el) {
				// Push the part-of-speech name onto the list if checked
				if (el.checked) posList.push(el.getAttribute("data-pos"));
			});
			// Loop through every word and determine if we should add it to the output
			englishWords.forEach(function(wrd) {
				var gematriaVal = gematria(wrd.word);
				// Reduce the value if needed
				if (mod26) gematriaVal = Number((gematriaVal - 1n) % 26n + 1n);
				// Add if the values are equal
				if (val == gematriaVal) addWordToOutput(wrd, posList);
			});
		}
		// If we are doing a straight gematria calculation of one word...
		else
		{
			console.log(gematria(val));
		}
	};
	
	// Checking the checkboxes will also update the output like with the inputEl input handler
	checkboxContainerEl.getElementsByTagName("input").forEach(function(el) {
		el.onclick = inputEl.oninput;
	});
}

// Add new word to Gematria-Bot's output
function addWordToOutput(wd, posList) {
	var outputEl = get("gematriabot-output");
	
	for (var partOfSpeech of wd.pos)
	{
		if (posList.length == 0 || posList.includes(partOfSpeech))
		{
			var newWord = document.createElement("span");
			newWord.textContent = wd.word;
			newWord.className = wordClassNames[partOfSpeech];
			outputEl.appendChild(newWord);
		}
	}
}

